import { useContext } from "react"
import { ContextData } from "../MainDom"

function Cards (){
    const context = useContext(ContextData)
    return (
        <div className="boxFix">
        <h2>{context.card.title}</h2>
        <p>{context.card.detail}</p>
        </div>
    )
}
export default Cards
